const App = () => {

    const button = document.getElementById('button');

    const [background, setBackground] = useState('#EA3A0D');

    return (
        <>
            <div className='container' style={{backgroundColor : background}}>
                <button id='button'> Click Me</button>
            </div>
        </>
    );
}

export default App;
